import React from 'react';
import LoginPage from './components/LoginPage';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import RegisterPage from './components/RegisterPage';
import Header from './components/Header';
import ProductListing from './components/ProductListing';
import Product from './components/Product';
import ProductDetail from './components/ProductDetail';
import Container from '@mui/material/Container';
import Grid from '@mui/material/Grid';
import { Typography } from '@mui/material';
import CalorieInfoPage from './components/CalorieInfoPage';
import NavigationBar from './components/NavigationBar';

function App() {
  return (
    <BrowserRouter>
      <Header />
      <NavigationBar />
      <Container>
        <Routes>
          <Route path="/productList" element={<ProductListing />} />
          <Route path="/product" element={<Product />} />
          <Route path="/product/:productId" element={<ProductDetail />} />
          <Route path="/calorieInformation" element={<CalorieInfoPage />} />
          <Route path="/loginPage" element={<LoginPageWithNavBar />} />
        </Routes>
      </Container>
    </BrowserRouter>
  );
}

function LoginPageWithNavBar() {
  return (
    <>
      <BrowserRouter>
        <Header />
        <Container>
          <Routes>
            <Route path="/loginPage" element={<LoginPage />} />
            <Route path="/loginPage" element={<RegisterPage />} />
          </Routes>
        </Container>
      </BrowserRouter>
    </>
  );
}

export default App;
